# Create a BeautifulSoup object from the HTML content
soup = BeautifulSoup(table, 'html.parser')

# Find the table element in the HTML
table = soup.find('table')

# Iterate over each row in the table
for row in table.find_all('tr'):
    # Find all the columns in the current row
    columns = row.find_all('td')
    
    # Check if the row has at least two columns
    match len(columns):
        case 2:
            if (("Closed" in columns[1].text.rstrip()) == False) and (("Proposed" in columns[1].text.rstrip()) == False) and (("Service discontinued" in columns[1].text.rstrip()) == False):
                stops.append(columns[0].text.rstrip())
        case 3:
            if (("Closed" in columns[2].text.rstrip()) == False) and (("Proposed" in columns[2].text.rstrip()) == False) and (("Service discontinued" in columns[2].text.rstrip()) == False):
                stops.append(columns[1].text.rstrip())
        case 4:
            if (("Closed" in columns[3].text.rstrip()) == False) and (("Proposed" in columns[3].text.rstrip()) == False) and (("Service discontinued" in columns[3].text.rstrip()) == False):
                stops.append(columns[2].text.rstrip())
                
